import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { Ionicons } from "@expo/vector-icons";
import SellerButtons from "../Component/Home/SellerButtons";
import carlogo from "../../assets/carlogo.png";
import applogo from "../../assets/applogo.png";
import apartlogo from "../../assets/apartlogo.png";
import furnlogo from "../../assets/furnlogo.png";

const options = [
  { label: "Name", value: "name" },
  { label: "Age", value: "age" },
  { label: "Number", value: "number" },
];

const SellerPage = () => {
  return (
    <View style={styles.bgContainer}>
      <View style={styles.headerContainer}>
        <Ionicons name="arrow-back-circle-sharp" size={24} color="black" />
        <Text style={styles.headerText}>WHAT ARE YOU OFFERING?</Text>
      </View>
      <View>
        <View style={styles.btnContainer}>
          <SellerButtons
            setbtnText={(value) => console.log(value)}
            imageSource={carlogo}
            placeholder="ADD YOUR CAR"
            options={options}
          />
        </View>
        <View style={styles.btnContainer}>
          <SellerButtons
            setbtnText={(value) => console.log(value)}
            imageSource={applogo}
            placeholder="ADD YOUR APPARELS"
            options={options}
          />
        </View>
        <View style={styles.btnContainer}>
          <SellerButtons
            setbtnText={(value) => console.log(value)}
            imageSource={apartlogo}
            placeholder="ADD YOUR APPARTMENT"
            options={options}
          />
        </View>
        <View style={styles.btnContainer}>
          <SellerButtons
            setbtnText={(value) => console.log(value)}
            imageSource={furnlogo}
            placeholder="ADD YOUR FURNITURE"
            options={options}
          />
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  bgContainer: {
    flex: 1,
    backgroundColor: "#D2C6C6",
  },
  headerContainer: {
    flexDirection: "row",
    backgroundColor: "#8A7A7A",
    height: 52,
    alignItems: "center",
    shadowColor: "#000000",
    shadowOffset: {
      width: 0,
      height: 3,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
    paddingHorizontal: 10,
  },
  headerText: {
    color: "#FFFFFF",
    fontSize: 15,
    textAlign: "center",
    marginLeft: 50,
  },
  btnContainer: {
    justifyContent: "center",
    alignItems: "center",
    marginTop: 20,
  },
});

export default SellerPage;
